import React, {Component} from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import Navbar from './components/navigation/Navbar';
import Search from './components/navigation/SearchBar';
import Login from './components/auth/Login';
import SignUp from './components/auth/SignUp';
import Profile from './components/ups/Profile';
import StartATrade from './components/trade/StartATrade';
// import Home from './components/home/Home';
// import NameTitle from './components/home/NameTitle';
// import {Container} from 'reactstrap';
// import EditProfile from './components/ups/EditProfile';
// import Landing from "./components/auth/Landing";
// import Trade from './components/trade/Trade';
// import NavCart from './components/navigation/NavCart';
// import Cart from './components/navigation/Cart';
// import TradeCart from './components/trade/Cart';

class App extends Component {
  render() {
    return (
        <Router>
          <div className="App">
            <Navbar/>
            <Search/>
            <div className="Container">
              <Route exact path="/login" component ={Login} />
              <Route exact path="/signup" component ={SignUp} />
              <Route exact path="/profile" component ={Profile} />
              <Route exact path="/startatrade" component ={StartATrade} />
            </div>
          </div>
        </Router>
    );
  }
}
export default App;
